const SVGComponent = ({ category, name, size, color, ...props }) => {
  const path = IconPaths[category] && IconPaths[category][name];
  if (!path) {
    console.warn(`SVG path not found for "${category}.${name}"`);
    return null;
  }

  return (
    <Svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="0 0 32 32"
      width={size}
      height={size}
      fill={color}
      {...props}
    >
      {path}
    </Svg>
  );
};

